            }
            if (stk.length) {
                left[i] = stk[stk.length - 1];
            }
            stk.push(i);
        }
        stk = [];
        for (let i = n - 1; i >= 0; i--) {
            let v = nums[i];
            while (stk.length && nums[stk[stk.length - 1]] < v) {
                stk.pop();
            }
            if (stk.length) {
                right[i] = stk[stk.length - 1];
            }
            stk.push(i);
        }
        return nums.reduce((acc, v, i) => acc + (i - left[i]) * (right[i] - i) * v, 0);
    }
    let mx = f(nums);
    let mi = f(nums.map(v => -v));
    return mx + mi;
